script: |
  super -f text -I q8689.spq | sort > q8689.out

inputs:
  - name: q8689.spq
    data: |
      SELECT + 23 AS col0 FROM tab1 (FORMAT parquet) WHERE - col2 + - col2 NOT IN ( + - col1 + - + col1, ( - col2 ), col1 );
  - name: tab1

outputs:
  - name: q8689.out
    data: |
      23
      23
      23
